import Colors from "../css/Colors"

const MaterialNumberScreenStyle = {
    headerShown:true,
    headerTitle:"Filter By: Material Number",
    headerTintColor:Colors.whiteColor,
    headerStyle:{
      backgroundColor:Colors.pageBgColor
    }
}

export default MaterialNumberScreenStyle
